import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";
import Login from "./components/Auth/Login";
import Register from "./components/Auth/Register"; // Si ya tienes Register creado
import AdminDashboard from "./components/Admin/AdminDashboard";
import UserDashboard from "./components/User/UserDashboard";

function App() {
  const handleLogin = (role) => {
    if (role === "ADMIN") {
      window.location.href = "/admin-dashboard";
    } else {
      window.location.href = "/user-dashboard";
    }
  };

  return (
    <Router>
      <div className="welcome-container">
        <div className="welcome-content">
          <h1 className="main-title">PROPSUITE</h1>
          <hr className="divider" />
          <Routes>
            <Route
              path="/"
              element={
                <>
                  <h2 className="subtitle">
                    ¡Gestión de edificios al alcance de tus manos!
                  </h2>
                  <div className="button-container">
                    <Link to="/login" className="custom-button">
                      Iniciar Sesión
                    </Link>
                    <Link to="/register" className="custom-button">
                      Registrarse
                    </Link>
                  </div>
                </>
              }
            />
            <Route path="/login" element={<Login onLogin={handleLogin} />} />
            <Route path="/register" element={<Register />} />
            <Route path="/admin-dashboard" element={<AdminDashboard />} />
            <Route path="/user-dashboard" element={<UserDashboard />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
